import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 55.1-2416 Removal of parcels from the certificate.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2416.md","filePath":"vacode/55.1-2416.md"}'),o={name:"vacode/55.1-2416.md"},c=a('<h1 id="§-55-1-2416-removal-of-parcels-from-the-certificate" tabindex="-1">§ 55.1-2416 Removal of parcels from the certificate. <a class="header-anchor" href="#§-55-1-2416-removal-of-parcels-from-the-certificate" aria-label="Permalink to &quot;§ 55.1-2416 Removal of parcels from the certificate.&quot;">​</a></h1><p>If the escheator finds that the escheat of a parcel was improper, for whatever reason, he shall remove the parcel from the certificate transmitted to the State Treasurer pursuant to § <a href="/vacode/55.1-2415/">55.1-2415</a> at any time prior to sale pursuant to § <a href="/vacode/55.1-2419/">55.1-2419</a>. The escheator shall state in writing his reasons for such removal to the satisfaction of the State Treasurer. Thereafter, unless a petition has been filed in accordance with § <a href="/vacode/55.1-2409/">55.1-2409</a>, the escheator shall petition the circuit court to correct the verdict returned to the clerk of court pursuant to § <a href="/vacode/55.1-2408/">55.1-2408</a>. A copy of this petition shall be sent to the State Treasurer. The escheator shall notify in writing the local treasurer or the local official performing these duties of any such error and improper escheat. The escheator shall be reimbursed the costs incurred by him for filing such a petition with the circuit court. The escheator shall file, and the clerk of court shall record, any such corrected verdict in the appropriate deed books.</p><p>1984, c. 315, § 55-182.1; 1990, c. 938; 1991, c. 684; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),i=[c];function s(h,l,n,f,p,d){return t(),r("div",null,i)}const _=e(o,[["render",s]]);export{m as __pageData,_ as default};
